import React, { useEffect, useState } from 'react';
import axios from 'axios';

const VisualizationContainer = () => {
  const [points, setPoints] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    axios
      .get('http://localhost:8000/points')
      .then((response) => {
        setPoints(response.data.points);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching points:', error);
        setError('Failed to fetch points');
        setLoading(false);
      })
  }, []);

  const width = 500
  const height = 500


  return (
    <div>
      <h1>Visualization</h1>
      {loading && <p>Loading...</p>}
      {error && <p>{error}</p>}
      {!loading && points.length > 0 && <p>{`Point 0: x=${points[0][0]}, y=${points[0][1]}, z=${points[0][2]}`}</p>}
      <svg width={width} height={height} style={{ border: '1px solid black' }}>
        <circle key="1" cx={(points[0][0]) * 10 + width/2} cy={(points[0][1]) * 10 + height/2} r={"2"} fill="blue" />
        {points.map((point, i) => {
          return <circle key={i} cx={(point[0]) * 10 + width/2} cy={(points[0]) * 10 + height/2} r={"2"} fill="blue" />
        })}
        <circle key="1" cx={width/2} cy={height/2} r={"2"} fill="blue" />
      </svg>
    </div>
  );
};

export default VisualizationContainer;
